import React, { useState, useEffect } from "react";
import "./styles.css";

export default function Log() {
  useEffect(() => {
    document.title = "Log Game Night";
  }, []);
  return (
    <div>
      <div className="text">
        <h2>Log Game Night</h2>
      </div>
    </div>
  );
}
